import styled from 'styled-components';
import {Blueprint, Container, Title1, Ps4Controller} from '../index';

const BodyCircle1 = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #fff;
`;

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <Blueprint>
                    <Ps4Controller>
                        <BodyCircle1></BodyCircle1>
                    </Ps4Controller>
                </Blueprint>
            </Container>
        );
    }
}

export default Main;
